Варианты экскурсионного обслуживания (по выбору туриста):
1 ВАРИАНТ: пешеходная экскурсия «Кинешма. Истории и судьбы» с посещением Троицко-Успенского кафедрального собора и Кинешемского художественно-исторического музея;
2 ВАРИАНТ: пешеходная экскурсия «Кинешма &mdash; земля А.Н. Островского» с посещением Троицко-Успенского кафедрального Собора,  Кинешемского драматического театра имени А.Н.Островского и Музея истории театра.

Варианты экскурсионного обслуживания (по выбору туриста):
1 ВАРИАНТ: обзорная пешеходная экскурсия по городу, этнографический музей с интерактивной программой (рекомендовано детям);
2 ВАРИАНТ: обзорная пешеходная экскурсия по городу с посещением художественно-исторического музея им. А.В. Григорьева. 
Дополнительные экскурсии: 
1 ВАРИАНТ: музей купеческого быта;
2 ВАРИАНТ: музей О. Бендера.

Варианты экскурсионного обслуживания (по выбору туриста):
1 ВАРИАНТ: пешеходная экскурсия в Макарьевский монастырь;
2 ВАРИАНТ: посещение страусиной фермы «Макарьевский страус» (рекомендовано для детей).

Обзорная автобусная экскурсия по городу.
Посещение (по выбору туриста):
1 ВАРИАНТ: «Город мастеров» (рекомендовано детям); 
2 ВАРИАНТ: музей «Дом графини Паниной»;
3 ВАРИАНТ: музей «Городец на Волге».

Варианты экскурсионного обслуживания (по выбору туриста):
1 ВАРИАНТ: обзорная пешеходная экскурсия по городу, «Дворец Мыши», экспозиция «Амбарные мыши» (рекомендовано для детей);
2 ВАРИАНТ: обзорная пешеходная экскурсия по городу. Посещение усадьбы купца Т.В. Чистова, домовой часовни, экспозиции «Купеческие лавки». Внешний осмотр частного домовладения современных мышкарей, домовладения дворян Степановых и сицкого сада, картинная галерея.
Дополнительные экскурсии:
1 ВАРИАНТ: интерактивная программа «В гости к мельнику на блины» (рекомендовано для детей);
2 ВАРИАНТ: мастер-класс «Мышкин пряник»;
3 ВАРИАНТ: мастер-класс «Цветок из дранки»;
4 ВАРИАНТ: автобусная экскурсия в Мартыново (вместо основной).
